def print_solution(data, manager, routing, solution):
    """Prints solution on console."""
    total_distance = 0
    total_load = 0
    total_ec = 0
    total_ce = 0
    for vehicle_id in range(data['num_vehicles']):
        index = routing.Start(vehicle_id)
        plan_output = 'Route for vehicle {}:\n'.format(vehicle_id)
        route_distance = 0
        route_load = 0
        while not routing.IsEnd(index):
            node_index = manager.IndexToNode(index)
            route_load += data['demands'][node_index]
            plan_output += ' {0} Load({1}) -> '.format(node_index, route_load)
            previous_index = index
            index = solution.Value(routing.NextVar(index))
            route_distance += routing.GetArcCostForVehicle(
                previous_index, index, vehicle_id)

        if data['truck'] == 1:
            """ Electric Truck """
            energy =  1/(0.00398502 * 93 * 0.357 * route_load * 0.0005 )

            carbon_emm =  16.08/(93 * 0.357 * route_load * 0.0005)

            t_km = route_load * 0.0005 * route_distance * 0.001

            ec = energy * t_km
            ce = carbon_emm * t_km



        elif data['truck'] == 0:
            """ Diesel Truck """
            energy = 4.3 + (1 / (87.3 * 0.093 * route_load * 0.0005)) + (405000 / (240000 * route_load * 0.0005))

            carbon_emm = 0.09 / (0.093 * route_load * 0.0005) + 29900 / (240000 * route_load * 0.0005)

            t_km = route_load * 0.0005 * route_distance * 0.001

            ec = energy * t_km
            ce = carbon_emm * t_km

        plan_output += ' {0} Load({1})\n'.format(manager.IndexToNode(index),
                                                 route_load)
        plan_output += 'Distance of the route: {} km\n'.format(round(route_distance * 0.001,2))
        plan_output += 'Load of the route: {} ton\n'.format(round(route_load * 0.0005,2))
        plan_output += 'Energy Consumed by this truck: {} MJ\n'.format(round(ec,2))
        plan_output += 'GHG Emission from this truck: {} kgCO2e\n'.format(round(ce, 2))
        print(plan_output)

        total_distance += route_distance
        total_load += route_load
        total_ec += ec
        total_ce += ce
    print('Total distance of all routes: {} km'.format(round(total_distance * 0.001,2)))
    print('Total load of all routes: {} tons'.format(total_load))
    print('Total energy consumed of all routes: {} MJ'.format(round(total_ec,2)))
    print('Total GHG emission of all routes: {} kgCO2'.format(round(total_ce, 2)))


def main():
    """Solve the CVRP problem."""
    # Instantiate the data problem.
    data = create_data_model()

    # Create the routing index manager.
    manager = pywrapcp.RoutingIndexManager(len(data['distance_matrix']),
                                           data['num_vehicles'], data['depot'])

    # Create Routing Model.
    routing = pywrapcp.RoutingModel(manager)


    # Create and register a transit callback.
    def distance_callback(from_index, to_index):
        """Returns the distance between the two nodes."""
        # Convert from routing variable Index to distance matrix NodeIndex.
        from_node = manager.IndexToNode(from_index)
        to_node = manager.IndexToNode(to_index)
        return data['distance_matrix'][from_node][to_node]

    transit_callback_index = routing.RegisterTransitCallback(distance_callback)

    # Define cost of each arc.
    routing.SetArcCostEvaluatorOfAllVehicles(transit_callback_index)


    # Add Capacity constraint.
    def demand_callback(from_index):
        """Returns the demand of the node."""
        # Convert from routing variable Index to demands NodeIndex.
        from_node = manager.IndexToNode(from_index)
        return data['demands'][from_node]

    demand_callback_index = routing.RegisterUnaryTransitCallback(
        demand_callback)
    routing.AddDimensionWithVehicleCapacity(
        demand_callback_index,
        0,  # null capacity slack
        data['vehicle_capacities'],  # vehicle maximum capacities
        True,  # start cumul to zero
        'Capacity')

    # Setting first solution heuristic.
    search_parameters = pywrapcp.DefaultRoutingSearchParameters()
    search_parameters.first_solution_strategy = (
        routing_enums_pb2.FirstSolutionStrategy.PATH_CHEAPEST_ARC)

    # Solve the problem.
    solution = routing.SolveWithParameters(search_parameters)

    # Print solution on console.
    if solution:
        print_solution(data, manager, routing, solution)


if __name__ == '__main__':
    main()

